import React from 'react';
import './CSS/watch.css'
const hostname = window.location.hostname;


export class WatchPage extends React.Component {

  constructor(props){
    super(props);

    this.state={
      sidebar: true
    }

  }


  render(){
    return(
    <div className="watchWrapper">
      <h1>WATCH</h1>
      <video id='videoContainer'>
      </video>
    </div>
    )
  }
}
